import React, { Component } from 'react'
import Tile from './Tile.js';

export default class TileGrid extends Component {
    constructor(props) {
        super(props);
        this.state = {
          count: 0,
        };
    }

    render() {
        return (
            <Tile name={props.count} image='dog' isFolder={true} />
        )
    }
}
